import './timer.css';
import React  from 'react';
import CountdownTimer from './CoundownTimer'
const Timer = () => {
return(
    <div className='app'>
        <CountdownTimer 
        CountdownTimesampMs={1704168192}/>
    </div>
);
}
export default Timer;
